import React from "react";

const Challenge1 = () => {
  return (
    <>
      <h1>Netflix App</h1>
      <p>List of Netflix WebSeries</p>
      <ul>
        <li>Money Heist</li>
        <li>Dark</li>
        <li>Kantara</li>
        <li>Kgf2</li>
        <li>Hum Tum</li>
      </ul>
    </>
  );
};

export default Challenge1;
